import axios from "axios"
import { useState, useEffect } from "react"

export default function Home(){
    const [posts,setPosts] = useState("")
    function getPosts(){
        axios({
            method : "GET",
            url : "/api/posts/?format=json"
        }).then((response) => {
           const newposts = response.data
            setPosts(newposts)
        })
    }
    useEffect(getPosts() , [])

    const elements = posts.map(post => <div>
        <h1>{post.title}</h1>
        <h2>{post.author}</h2>
        <p>{post.text}</p>
    </div>)

    return(
        <div>
            {elements}
        </div>
    )
}
